import Fade from "react-reveal";
import ParticlesBg from "particles-bg";

import "./styles.css"

function Landing() {
    return(
        <div id="landing" className="MainContent">
            <div className="navPadding"/>
            <ParticlesBg type="circle" bg={true}/>
            <Fade>
                <div className="landing">
                    <h6>Welcome</h6>
                    <div>I am Kyle</div>
                </div>
            </Fade>
        </div>    
    )
}

export default Landing;
